package com.sugon.analysis.domain.data.object.sugon.oracle;import lombok.Data;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.Table;/** * 绩效考核 */@Data@Entity@Table(name = "KPI_ZG_RESULT")public class KpiZGResult {    /**     * 主键     */    @Id    @Column(name = "ID")    private String id;    /**     * 年份     */    @Column(name="YEAR")    private String year;    /**     * 季度     */    @Column(name="QUARTER")    private String quarter;    /**     * 单位名称     */    @Column(name="COMPANY_NAME")    private String companyName;    /**     * 单位简称     */    @Column(name="COMPANY_NAME_SIMPLE")    private String companyNameSimple;    /**     * 组别     */    @Column(name="GROUPNAME")    private String groupName;    /**     * 合计     */    @Column(name="TOTAL_SCORE")    private String totalScore;    /**     * 党建基础     */    @Column(name="BASIC_PART_DEV")    private String basicPartDev;    /**     * 工作执行力     */    @Column(name="WORK_HANDLE_POWER")    private String workHandlePower;    /**     * 立功创模     */    @Column(name="LGCM")    private String lgcm;    /**     * 政工竞赛     */    @Column(name="ZGJS")    private String zgjs;    /**     * 新闻宣传     */    @Column(name="XWXC")    private String xwxc;    /**     * 政工信息调研     */    @Column(name="ZGXXDY")    private String zgxxdy;    /**     * 警营专项文化和两微运维     */    @Column(name="ITEM1")    private String item1;    /**     * 警营文\体工作     */    @Column(name="ITEM2")    private String item2;    /**     * 警体运动会     */    @Column(name="ITEM3")    private String item3;    /**     * 实战训练     */    @Column(name="ITEM4")    private String item4;    /**     * 教官队伍建设     */    @Column(name="ITEM5")    private String item5;    /**     * 警辅管理     */    @Column(name="ITEM6")    private String item6;    /**     * 工作任务完成     */    @Column(name="ITEM7")    private String item7;}